import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { ReactKeycloakProvider } from '@react-keycloak/web';
import useKeycloaks from './Keycloak'; // Import the useKeycloak hook
import reportWebVitals from './reportWebVitals';

const Root = () => {
  const keycloak = useKeycloaks(); // Call the useKeycloak hook inside a functional component
  return (
    <React.StrictMode>
      <ReactKeycloakProvider authClient={keycloak}>
        <App />
      </ReactKeycloakProvider>
    </React.StrictMode>
  );
};




const rootElement = document.getElementById('root');
ReactDOM.createRoot(rootElement).render(  <React.StrictMode>
  <BrowserRouter>
      <ReactKeycloakProvider authClient={keycloak}>
          <App />
      </ReactKeycloakProvider>
  </BrowserRouter>
</React.StrictMode>); // Render the Root component

reportWebVitals();
